public void shouldRemoveItemOnDemand() {
  Cache cache = new PerpetualCache("default");
  cache = new SynchronizedCache(cache);
  cache.putObject(0, 0);
  assertNotNull(cache.getObject(0));
  cache.removeObject(0);
  assertNull(cache.getObject(0));
}

